(function($){
	
	$(window).scroll(function(){
		
		if ($(this).scrollTop() > 50){
			$('#back-to-top').fadeIn(200);
		}
		else{
			$('#back-to-top').fadeOut(200);
		}
		
		if($(this).scrollTop() > 450) {
			$('.navbar-fixed-top').addClass('opaque');
		} else {
			$('.navbar-fixed-top').removeClass('opaque');
		}
	});

	$(document).ready(function () {
		
		if( Modernizr.mq( 'only screen and (min-width: 768.98px)' ) ) {
			wow = new WOW({
				boxClass:     'wow',      // default
				animateClass: 'animated', // default
				offset:       0,          // default
				mobile:       false,       // default
				live:         true        // default
			});
			
			wow.init();
		}
		
		$("#back-to-top").click(function () {
			$("html, body").animate({scrollTop: 0}, 1000);
		});
	
		$('.sona-sticky').each(function(e){
			
			var iam = this;	
			var me = $(this);	
			var run = true;
			var display = me.css('display');
			var top = me.offset().top;
		
			$(window).scroll(function (event) {
				
				var y = $(this).scrollTop();
				
				if(( Modernizr.mq('only screen and (min-width: 768px)') && me.hasClass('mobile') ) || ( Modernizr.mq( 'only screen and (max-width: 767.98px)' ) && me.hasClass('desktop') ) ){
	
					run = false;
				}
				
				if (run == true && y > top){
					
					me.addClass('navbar-fixed-top opaque');
					me.css({'display': 'block'});
					
					var callback1 = me.data('callback1');					
					if (callback1 && typeof window[callback1] === 'function') {
						sona_callback(callback1, iam);
					}
					
				}else{
				
					me.removeClass('navbar-fixed-top').removeClass('opaque');
					me.css({'display': display});
					
					var callback2 = me.data('callback2');
					if (callback2 && typeof window[callback2] === 'function') {
						sona_callback(callback2, iam);
					}
				}
				
				event.preventDefault();
			});
		});
		
		$('[data-toggle="tooltip"]').tooltip();
		
		$('#owl2').owlCarousel({
			center:true,
			autoplay:true,
			loop:true,
			margin:40,
			nav:false,
			responsiveClass:true,
			responsive:{
				0:{
					items:1,
					nav:false
				},
				600:{
					items:2,
					nav:false
				},
				1000:{
					items:4,
					nav:false,
					loop:true
				}
			}
		});
		
		$(".nav li a, a.scrool").on('click', function(e) {
		
			var full_url = this.href;
			var parts = full_url.split("#");
			var trgt = parts[1];
			var target_offset = $("#"+trgt).offset();
			var target_top = target_offset.top;
			
			$('html,body').animate({scrollTop:target_top -70}, 1000);
			
			return false;
		});
		
		$('.popup-gallery').find('a.popup1').magnificPopup({
			type: 'image',
			gallery: {
			  enabled:true
			}
		}); 
		
		$('.popup-gallery').find('a.popup2').magnificPopup({
			type: 'image',
			gallery: {
			  enabled:true
			}
		}); 
	 
		$('.popup-gallery').find('a.popup3').magnificPopup({
			type: 'image',
			gallery: {
			  enabled:true
			}
		}); 
	 
		$('.popup-gallery').find('a.popup4').magnificPopup({
			type: 'iframe',
			gallery: {
			  enabled:false
			}
		});
	});
})(jQuery);